codon_match_table = {'A' : '4', 'D' : '2', 'E':'2', 'I':'3', 'K' : '2', 'T' :'4', 'R':'6', 'C':'2', 'G':'4', 'M':'1', 'F':'2', 'W':'1', 'P':'4', 'Y':'2', 'N': '2', 'Q':'2', 'H' : '2', 'L': '6', 'S': '6', 'V': '4'}
AA_seq = ''
result = 1
for i in AA_seq:
    result = (result*int(codon_match_table[i]))

print(result*3%100000)
# codonmatchtable의 value를 숫자가 아닌 스트링으로 입력해서 5열에 result(숫자) * 스트링 꼴이 되어서 연산이 안됐다. int 통해 해결